import React from 'react'
import Chat from './Chat'
function Card(props) {
    const getCard = props.card
    return (  
        getCard.map((items)=>{
            <div>
                <p>{items.name}</p>
                <img src={items.avatar}/>
                <p>items.</p>
            </div>
        }) 
        
    )
}

export default Card
